import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";
import Card from "@material-ui/core/Card";
import CardHeader from "@material-ui/core/CardHeader";
import ThumbUpAltRoundedIcon from '@material-ui/icons/ThumbUpAltRounded';
import CardContent from "@material-ui/core/CardContent";
import CardActions from "@material-ui/core/CardActions";
import Avatar from "@material-ui/core/Avatar";
import IconButton from "@material-ui/core/IconButton";
import Typography from "@material-ui/core/Typography";
import ShareIcon from "@material-ui/icons/Share";
import VisibilityOutlinedIcon from "@material-ui/icons/VisibilityOutlined";
import Card1 from "../images/card1.jpg";
import Card2 from "../images/card2.jpg";
import Card3 from "../images/card3.jpg";
import Card4 from "../images/card4.jfif";
import Card5 from "../images/card5.jfif";
import Card6 from "../images/card6.jfif";
import ChatBubbleRoundedIcon from '@material-ui/icons/ChatBubbleRounded';
import Profile1 from "../images/profile1.jfif";
import Profile2 from "../images/profile2.jfif";
import Profile3 from "../images/profile3.jfif";
import Profile4 from "../images/profile4.jfif";
import Profile5 from "../images/profile5.jfif";
import Profile6 from "../images/profile6.jfif";






const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    marginTop: "2rem",
    borderRadius: "22px",
    width:"623px"
    },
  media: {
    height: 0,
    paddingTop: "56.25%", // 16:9
  },
  Readmore: {
    color: " rgba(55, 43, 255, 1)",
    cursor: "pointer",
    fontFamily: "Calibri",
    marginLeft:"0.1rem"
  },
  avatar: {
    width: "3rem",
    height: "3rem",
    borderRadius: "50%",
    top: -51,
    boxShadow: " 0 0 0 0.125rem #fff, 0 0.1875rem 0.4375rem rgba(90,97,105,.5)",
  },
}));

export default function CenteredGrid() {
  const classes = useStyles();

  return (
    <div className={classes.root1}>

      {/* Grid 1 Card */}


      {/* Grid 2 Card */}
      <Grid container spacing={5} style={{backgroundColor:"#FFF9F9"}}>
        <Grid item xs={4}>
          <Card className={classes.root}>
            <img
              src={Card4}
              alt="Card4"
              style={{
                width: "452px",
                height: "15.8rem",
              }}
            ></img>
            <CardHeader
              avatar={
                <Avatar aria-label="recipe" className={classes.avatar}>
                  <img src={Profile4} alt={Profile4} style={{width:"45px"}}></img>
                </Avatar>
              }
              action={<IconButton aria-label="settings"></IconButton>}
              title="Shrimp and Chorizo Paella"
              subheader="John Doe"
            />
            <CardContent>
              <Typography variant="body2" color="textSecondary" component="p">
                This impressive paella is a perfect party dish and a fun meal to
                cook together with your guests. Add 1 cup of frozen peas along
                with the mussels, if you like.
              </Typography>
            </CardContent>
            <CardActions disableSpacing>
              <h4 className={classes.Readmore}>Read More</h4>
              <IconButton
                aria-label="add to favorites"
                style={{ marginLeft: "10.2rem" }}
              >
                <VisibilityOutlinedIcon />
              </IconButton>
              <IconButton aria-label="add to favorites">
                <ThumbUpAltRoundedIcon />
              </IconButton>
              <IconButton aria-label="add to favorites">
                <ChatBubbleRoundedIcon />
              </IconButton>
              <IconButton aria-label="share">
                <ShareIcon />
              </IconButton>
            </CardActions>
          </Card>
        </Grid>
        <Grid item xs={4}>
          <Card className={classes.root}>
            <img
              src={Card5}
              alt="Card5"
              style={{
                width: "452px",
                height: "15.8rem",
              }}
            ></img>
            <CardHeader
              avatar={
                <Avatar aria-label="recipe" className={classes.avatar}>
                  <img src={Profile5} alt={Profile5} style={{width:"45px"}}></img>
                </Avatar>
              }
              action={<IconButton aria-label="settings"></IconButton>}
              title="Shrimp and Chorizo Paella"
              subheader="John Doe"
            />
            <CardContent>
              <Typography variant="body2" color="textSecondary" component="p">
                This impressive paella is a perfect party dish and a fun meal to
                cook together with your guests. Add 1 cup of frozen peas along
                with the mussels, if you like.
              </Typography>
            </CardContent>
            <CardActions disableSpacing>
              <h4 className={classes.Readmore}>Read More</h4>
              <IconButton
                aria-label="add to favorites"
                style={{ marginLeft: "10.2rem" }}
              >
                <VisibilityOutlinedIcon />
              </IconButton>
              <IconButton aria-label="add to favorites">
                <ThumbUpAltRoundedIcon />
              </IconButton>
              <IconButton aria-label="add to favorites">
                <ChatBubbleRoundedIcon />
              </IconButton>
              <IconButton aria-label="share">
                <ShareIcon />
              </IconButton>
            </CardActions>
          </Card>
        </Grid>
        <Grid item xs={4}>
          <Card className={classes.root}>
            <img
              src={Card6}
              alt="Card6"
              style={{
                width: "452px",
                height: "15.8rem",
              }}
            ></img>
            <CardHeader
              avatar={
                <Avatar aria-label="recipe" className={classes.avatar}>
                  <img src={Profile6} alt={Profile6} style={{width:"45px"}}></img>
                </Avatar>
              }
              action={<IconButton aria-label="settings"></IconButton>}
              title="Shrimp and Chorizo Paella"
              subheader="John Doe"
            />
            <CardContent>
              <Typography variant="body2" color="textSecondary" component="p">
                This impressive paella is a perfect party dish and a fun meal to
                cook together with your guests. Add 1 cup of frozen peas along
                with the mussels, if you like.
              </Typography>
            </CardContent>
            <CardActions disableSpacing>
              <h4 className={classes.Readmore}>Read More</h4>
              <IconButton
                aria-label="add to favorites"
                style={{ marginLeft: "10.2rem" }}
              >
                <VisibilityOutlinedIcon />
              </IconButton>
              <IconButton aria-label="add to favorites">
                <ThumbUpAltRoundedIcon />
              </IconButton>
              <IconButton aria-label="add to favorites">
                <ChatBubbleRoundedIcon />
              </IconButton>
              <IconButton aria-label="share">
                <ShareIcon />
              </IconButton>
            </CardActions>
          </Card>
        </Grid>
      </Grid>
    </div>
  );
}
